import React from 'react';
import { useNavigate } from 'react-router-dom';  
import '../styles/FeaturedSectionCards.css';

const FeaturedSectionCards = () => {
  const navigate = useNavigate();

  const cards = [
    {
      id: 'men',
      title: 'Men',
      image: 'https://images.unsplash.com/photo-1521334884684-d80222895322?auto=format&fit=crop&w=600&q=80',
      link: '/men',  
    },
    {
      id: 'women',
      title: 'Women',
      image: 'https://unsplash.com/photos/photo-of-woman-holding-white-and-black-paper-bags-_3Q3tsJ01nchttps://images.unsplash.com/photo-1483985988355-763728e1935b?q=80&w=1170&auto=format&fit=crop&ixlib=rb-4.1.0&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3Dhttps://unsplash.com/photos/time-is-for-gossip-after-shopping-sOnR5kVqpic',
      link: '/women',
    },
    {
      id: 'kids',
      title: 'Kids',
      image: 'https://images.unsplash.com/photo-1524503033411-c9566986fc8f?w=600&auto=format&fit=crop&q=60&ixlib=rb-4.1.0&ixid=M3wxMjA3fDB8MHxzZWFyY2h8NHx8a2lkc3xlbnwwfHwwfHx8MA%3D%3D',
      link: '/kids',
    },
  ];

  return (
    <section className="featured-section-cards-container">
      <h1 className="featured-section-heading">Featured Section</h1>
      <div className="featured-section-cards">
        {cards.map(card => (
          <div
            className="featured-card"
            key={card.id}
            onClick={() => navigate(card.link)}
            role="button"
            tabIndex={0}
            onKeyDown={(e) => {
              if (e.key === 'Enter' || e.key === ' ') navigate(card.link);
            }}
          >
            <img src={card.image} alt={card.title} />
            <div className="card-overlay">
              <h2>{card.title}</h2>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default FeaturedSectionCards;
